import './App.css';
import React from 'react';
import InputField from './InputField';

const App = () => {
  const nameFieldStyle = {
    top: '235px',
    left: '846px',
    width: '468px',
    height: '48px',
    padding: '0px 8px',
    border: '0',
    boxSizing: 'border-box',
    borderRadius: '24px',
    backgroundColor: '#323232',
    color: '#bebebe',
    fontSize: '14px',
    fontFamily: 'Source Sans Pro',
    fontWeight: 500,
    lineHeight: '18px',
    outline: 'none',
    // other styles...
  };

  const emailFieldStyle = {
    top: '327px',
    left: '846px',
    width: '468px',
    height: '48px',
    padding: '0px 8px',
    border: '0',
    boxSizing: 'border-box',
    borderRadius: '24px',
    backgroundColor: '#323232',
    color: '#bebebe',
    fontSize: '14px',
    fontFamily: 'Source Sans Pro',
    fontWeight: 500,
    lineHeight: '18px',
    outline: 'none',
    // other styles...
  };

  return (
    <div>
      <InputField style={nameFieldStyle} text="Your full name" />
      <InputField style={emailFieldStyle} text="Enter your email address" />
    </div>
  );
};

export default App;
